import React, { useState, useEffect } from 'react';
import { Card, Typography, Button, IconButton } from '@material-ui/core';
import { useMeasure } from 'react-use';
import { useSpring, animated } from 'react-spring';
import DoubleChevronIcon from '../icons/DoubleChevrons.svg';


function Test(){

  return(
    <div>
      <animated.div>
        <Card style={{marginTop: 50, border: "3px dotted black"}}>
          Hello
          <div>
            Is it me you're looking for?
          </div>
        </Card>
      </animated.div>
      <button>
        <img src={DoubleChevronIcon}/>
      </button>
    </div>
  )
}

export default Test;
